<script>
  export let name;
  export let url;
  export let format;
  let highBandwith;
  function getCookie(name) {
    var nameEQ = name + "=";
    var ca = document.cookie.split(';');
    for(var i=0;i < ca.length;i++) {
      var c = ca[i];
      while (c.charAt(0)==' ') c = c.substring(1,c.length);
      if (c.indexOf(nameEQ) == 0) return c.substring(nameEQ.length,c.length);
    }
    return null;
  }
  if (getCookie("high_bandwith") == "true") {
    highBandwith = true;
  }
  let loading = "data:image/png;base64,";
  let placeholder = "data:image/png;base64,";
</script>

<style>
  main {
    display: inline-block;
    background-color: #23272A;
    height: 290px;
    width: 290px;
    box-shadow: 0 2px 10px 0 rgb(0 0 0 / 20%);
    border-radius: 5px;
  }
  
  main img {
    display: inline-block;
    width: 200px;
    height: 200px;
  }

  main h3 {
    text-decoration: underline;
  }

  a {
    color:white;
    text-decoration: underline;
  }
</style>

{#if highBandwith}
  <main>
    <h3>{name}</h3>
    <a href="pack/{name.replace(/ /g, "+")}?format={format}"><img alt="" src="{loading}" loading="eager" onload="this.src = '{url}'"/></a>
  </main>
{:else}
  <main>
    <a href="/pack/{name.replace(/ /g, "+")}?format={format}"><h3>{name}</h3></a>
    <a href><img alt="" src="{placeholder}" loading="eager" onclick="load(this, '{name}', '{format}')" data-src="{url}"/></a>
  </main>
{/if}